import React from "react";
import "./DisplayTime.css";

const DisplayTime = (props) => {

    return (
        <><span className={`timeLabel ${props.myClassName}`}>{props.label ? props.label : 'Time:'} </span><span className="numbers">{props.time}</span></>
    );
};

export default DisplayTime;
